import React from 'react';

function About() {
  return (
    <section className="my-5">
      <div className="my-2">
        <div className="profile-img my-5">
        <i className="fas fa-user-circle" style={{ fontSize: "96px" }}></i>
        </div>
        <p>
        Hi, my name is Emerald Green, and I am a full-stack web application developer, currently living in Austin, TX. I have a Bachelor of Arts in Organismal Biology & Ecology and Classics from Colorado College. Post-undergrad, I committed my career to advancing equity with mission-based organizations in my community as Consumer Assistance Program Coordinator for Colorado Consumer Health Initiative, along with serving as the Program Coordinator for the F2F (family to family) project at Family Voices Colorado. Through my experience in these roles, I gained valuable skills in problem-solving and project management that I am excited to apply in my web development career. 
        </p>
        <p>
        Before taking the University of Denver's full-stack bootcamp, I explored coding by using Python to program Roombas at the Tennessee Governor's School for the Sciences & Engineering summer program. This experience sparked my interest in technology. During my time at CC, I worked in the ITS Solutions Center and Tech Sandbox. There, I was exposed to a new technologies like the Oculus Quest, Microsoft HoloLens, VIVE headset, and 3D printing. I improved my diversity of knowledge through the COMPTIA A+ training and exam. As part of this training, I immersed myself in internal hardware components by destroying and rebuilding a PC. Through these experiences, I have been exposed to different tools in various fields of software and hardware development that I hope to apply to my future career.
        </p>
      </div>
    </section>
  );
}

export default About;
